INSERT INTO `wp_posts` VALUES (10,1,'2020-11-10 02:32:40','2020-11-10 02:32:40','<h3>Description</h3>\r\nBringing native species, which have been threatened with extinction, back into our backyards, local walks and along our beaches. This project provides protection for taonga/ treasured species around the one main township on Stewart Island, allowing them to thrive. Through this project, we have been able to bring species which have disappeared from the area over time, back home.\r\n\r\nVolunteering opportunties include working with staff and other volunteers to restore habitat, remove pest species or monitor the project results. We also work closely with other organisations where our goals coincide.\r\n<h3>Contact Information</h3>\r\ne-mail:\r\ninfo@sircet.org.nz\r\n\r\n&nbsp;','Halfmoon Bay Habitat Restoration Project - Southland','','trash','closed','closed','','halfmoon-bay-habitat-restoration-project-southland__trashed','','','2020-11-11 01:30:00','2020-11-11 01:30:00','',0,'http://nztcv.local/?post_type=projects_region&#038;p=10',0,'projects_region','',0);
INSERT INTO `wp_posts` VALUES (11,1,'2020-11-10 02:33:17','2020-11-10 02:33:17','<h4>Description</h4>\r\nTiritiri Matangi is a conservation success story thanks to the involvement of thousands of volunteers planting trees and the successful transfer of endangered bird and reptile species. Although the planting programme is now complete, volunteer involvement is still important to support the Department in maintaining this island sanctuary. Volunteers assist the island rangers with a wide range of tasks, including track maintenance, beach cleanups and general maintenance. There are very few opportunities to be involved in species work but the island wildlife is easy to observe during your non-working time.\r\n<ul>\r\n 	<li>Accommodation provided: Shared bunkhouse</li>\r\n 	<li>Transport provided: Ferry</li>\r\n 	<li>What to bring: Gear list provided once placement confirmed</li>\r\n</ul>\r\nEvery week, Sunday morning to Saturday afternoon, except during Christmas/New Year holidays\r\n<h4>Contact Information</h4>\r\nSue Cameron\r\nVolunteer Coordinator\r\nAuckland Conservancy\r\nTel - 09 425 7812\r\nEmail - aucklandvolunteer@doc.govt.nz','Tiritiri Matangi Volunteer Programme - Auckland','','publish','closed','closed','','tiritiri-matangi-volunteer-programme-auckland','','','2020-12-03 03:52:46','2020-12-03 03:52:46','',0,'http://nztcv.local/?post_type=projects_region&#038;p=11',0,'projects_region','',0);
INSERT INTO `wp_posts` VALUES (12,1,'2020-11-10 02:33:56','2020-11-10 02:33:56','<h4>Description</h4>\r\nKowai Bush is a valuable remnant of the forests that once clothed the entire region from the Malvern Hills to Oxford. We have several rare and endangered plants, trees and shrubs that need our protection and propagation.\r\n\r\nOur aim is to maintain, enhance and protect this area and the areas that are regenerating, by fencing, removal and control of the blackberry, broom, gorse and any other noxious plants, and animals, and to maintain the open spaces.\r\n\r\nWe will be organizing working bee twice yearly as well as running the ongoing projects.\r\n<h4>Contact information</h4>\r\nLouise Harris\r\nPh: 03 3849813 Mob: 021324646 E: l.harris@clear.net.nz\r\n4 Bay View Road, Moncks Bay Christchurch\r\n\r\nNigel Harris\r\nPh: 03 9814775 Mob: 021496944\r\n48 Riley Cres, Woolston Christchurch\r\n\r\nStephen Harris\r\nPh: 03 3254162 Mob: 021 0363581','Kowai Bush - Canterbury','','publish','closed','closed','','kowai-bush-canterbury','','','2020-12-03 03:52:22','2020-12-03 03:52:22','',0,'http://nztcv.local/?post_type=projects_region&#038;p=12',0,'projects_region','',0);
