INSERT INTO `wp_posts` VALUES (45,1,'2020-11-11 01:19:18','2020-11-11 01:19:18','Description\n\nKowai Bush is a valuable remnant of the forests that once clothed the entire region from the Malvern Hills to Oxford. We have several rare and endangered plants, trees and shrubs that need our protection and propagation.\n\nOur aim is to maintain, enhance and protect this area and the areas that are regenerating, by fencing, removal and control of the blackberry, broom, gorse and any other noxious plants, and animals, and to maintain the open spaces.\n\nWe will be organizing working bee twice yearly as well as running the ongoing projects.\n\nContact information\n\nLouise Harris\nPh: 03 3849813 Mob: 021324646 E: l.harris@clear.net.nz\n4 Bay View Road, Moncks Bay Christchurch\n\nNigel Harris\nPh: 03 9814775 Mob: 021496944\n48 Riley Cres, Woolston Christchurch\n\nStephen Harris\nPh: 03 3254162 Mob: 021 0363581','Kowai Bush - Canterbury','','inherit','closed','closed','','12-autosave-v1','','','2020-11-11 01:19:18','2020-11-11 01:19:18','',12,'http://nztcv.local/12-autosave-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (46,1,'2020-11-11 01:24:32','2020-11-11 01:24:32','There is a ferry every Saturday and Sunday and public holiday to Motuihe Island. The fare is $15 return for volunteers and $24 for non volunteers. The 360 Discovery ferry departs from Pier 3 at 9.15am and returns at 2,30pm and 5.30pm.\r\n\r\nBetween 26 Dec and 18 January the ferry will provide a daily service to Motuihe Island from Auckland and Gulf Harbour.','Motuihe Island - Auckland','','trash','closed','closed','','motuihe-island-auckland__trashed','','','2020-11-11 01:30:12','2020-11-11 01:30:12','',0,'http://nztcv.local/?post_type=projects_region&#038;p=46',0,'projects_region','',0);
INSERT INTO `wp_posts` VALUES (47,1,'2020-11-11 01:25:27','2020-11-11 01:25:27','Don\'t just read about us - get involved! There are lots of near opportunities; various forms of field work including being part of night kiwi survey teams, stoat trap setting; simple computer work including assisting with the processing of data collected through our night kiwi recorder devices (own computer required, all training provided); assisting with events and set-up of resources; any other skils you can offer us?','Taranaki Kiwi Trust - Taranaki','','trash','closed','closed','','taranaki-kiwi-trust-taranaki__trashed','','','2020-11-11 01:30:08','2020-11-11 01:30:08','',0,'http://nztcv.local/?post_type=projects_region&#038;p=47',0,'projects_region','',0);
INSERT INTO `wp_posts` VALUES (48,1,'2020-11-11 01:26:27','2020-11-11 01:26:27','<h4>Description</h4>\r\nLetterboxer is an environmental organisation that aims to reduce unnecessary junkmail. Letterboxer is about helping people take action, not just raising awareness.\r\n\r\nAre you interested in helping?\r\n<ul>\r\n 	<li>Raise awareness about junkmail and how to get free no-junkmail stickers</li>\r\n 	<li>Survey the streets in your area, offering free stickers</li>\r\n 	<li>Help in other ways</li>\r\n</ul>\r\n<h4>Contact Us</h4>\r\nwww.letterboxer.org.nz','Letterboxer - Nationwide','','publish','closed','closed','','letterboxer-nationwide','','','2020-12-03 03:51:37','2020-12-03 03:51:37','',0,'http://nztcv.local/?post_type=projects_region&#038;p=48',0,'projects_region','',0);
